    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Sand Lake NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how Sand Lake NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, an overview of the CCP process, a summary of Refuge resources, and information
    about the management direction. Key planning issues include: wildlife management,
    habitat management, public use, control of invasive species, and water management.",nt"license_title":
